import React from "react";
import "./Navbar.css";
import MobileMenu from "../MobileMenu/MobileMenu";

interface Navbar {
  mobile: boolean;
}

export default function Navbar({ mobile }: Navbar) {
  return (
    <div className="Navbar">
      <div className="logo-text">LUCKBRC</div>
      {mobile ? (
        <MobileMenu />
      ) : (
        <>
          <div className="navbar-text">Twitter</div>
          <div className="navbar-text">Discord</div>
          <div className="navbar-text">Unisat</div>
          <div className="navbar-text">Gate</div>
          <div className="navbar-text">Telegram</div>
        </>
      )}
    </div>
  );
}
